@dev Allows a voter to cast their vote through the proxy.
@param governor The governor contract to interact with.
@param proposalId The ID of the proposal to vote on.
@param support The voting choice (0 against, 1 for, 2 abstain).
@param lpTokens An array of liquidity pool tokens used for voting.

@dev Calculates the voting power of a voter based on their liquidity pool tokens.
@param voter The address of the voter.
@param snapshot The block number when the snapshot was taken.
@param lpToken The liquidity pool token used for voting.
@param votingToken The token used for voting.
@return votingPower The calculated voting power.

@dev Checks if a voter has already voted on a specific proposal.
@param governor The governor contract to interact with.
@param proposalId The ID of the proposal.
@param voter The address of the voter.
@param lpToken The liquidity pool token used for voting.
@return Returns true if the voter has already voted; otherwise, false.

@dev Initiates the process of casting aggregated votes for a specified proposal.
     This function validates that the function call is made after 80% of the full
     voting window has elapsed, providing a buffer period before the actual
     voting deadline.
@param governor The governor contract that manages the proposal.
@param proposalId The unique identifier for the proposal.

@notice Checks if all votes have been cast for a proposal.
@param governor The governor contract.
@param proposalId The proposal's unique identifier.
@return True if all votes are cast, false otherwise.

@notice Continues the process of casting votes for a given proposal.
@param governor The governor contract.
@param proposalId The proposal's unique identifier.

@dev Proposes a new governance action.
@param governor The governor contract to interact with.
@param lpToken The liquidity pool token used for voting power calculation.
@param targets The addresses to interact with.
@param values The values to pass with the function calls.
@param calldatas The calldata for each function call.
@param description A description of the proposal.
@return proposalId The ID of the newly created proposal.

@dev Retrieves the snapshot timestamp of a given proposal.
@param governor The governor contract that manages the proposal.
@param proposalId The unique identifier for the proposal in question.
@return snapshot The timestamp at which the voting snapshot for the proposal was taken.

@dev Gets the deadline timestamp for voting on a specified proposal.
@param governor The governor contract that manages the proposal.
@param proposalId The unique identifier for the proposal.
@return deadline The timestamp by which votes for the proposal need to be submitted.

@dev Calculates the deadline for proxy voting on a particular proposal.
     The proxy voting deadline is set at 80% of the full voting window to ensure
     that proxy votes are cast before the final voting deadline.
@param governor The governor contract that oversees the proposal.
@param proposalId The unique identifier for the proposal.
@return proxyDeadline The timestamp by which proxy votes for the proposal must be submitted.
